import React, {useState} from 'react';

const App = () =>{
const [input, setinput] = useState(6);
const [error, seterror] = useState();

const change = () =>{
    if(input == 6){
        setprogress(25);
    }
    else if(input == 16){
        setprogress(50);
    }
    else if(input == 24){
        setprogress(75);
    }
    else if(input == 32){
        setprogress(99);
    }
}
    return(
        <>
        <div>
            <input type="text" />
            <h1>{error}</h1>
        </div>
        <br/>
        <input type="text" value={input} onChange={(e) =>{
            setinput(e.target.value);
        }}/>
        <button onClick={change}
        >Change</button>
          </>
    )
}
export default App;
